column8:
エントランスや待合スペースの必需品です。<br>テーブルタイプで大きめのボードのため、記帳がしやすくなりました。<br>メニューや店舗案内などにもご使用いただくことができます。<br>
<br>
商品規格<br>
[サイズ]<br>
高さ:H920mm<br>
ボードサイズ:W440xD340x15mm<br>
底板:W350xD350x18mm<br>
<br>
[ボード]<br>
木製(白木)<br>
<br>
※組み立て式です。<br><div id="migi-obi">

<style>
#migi-obi * {
margin: 0;
padding: 0;
outline: 0;
background: url("http://image.rakuten.co.jp/atta-v/cabinet/campain/imgrc0064113094.jpg" ) repeat-y right top ;
}
#migi-obi a {
position: absolute;
top:80px;
right:0px;
height:13424px;/*ページ全体の高さ*/
width: 90px;/*帯の幅*/
}
</style>

</div>

可愛いカタチ、楽しいカタチ、目を引くカタチで大好評のポップルスタンド看板シルエット。<br><br>

従来のマーカーボードのように四角ではなく、形でアピールするので、注目度が格段に上がります。面板は、文字が映えるブラックボード、または清潔感溢れるホワイトボードの選べる2種類。布やティッシュペーパーなどで水拭きをすれば、サッと綺麗に消すことができます。また、耐水性の水性マーカーを使えば、多少の雨がかかっても消えません。<br><br>

お店のイメージにあったシルエットを選び、素敵なアレンジでPRしましょう。<br><br>

商品規格<br>
[サイズ]<br>
大:幅440x高890mm<br>
※形状により多少高さが上下します。<br><br>

[色]<br>
ブラックボード・ホワイトボード<br><br>

[素材]<br>
フレーム:アルミ押出し材/アルマイト仕上<br>
面板:アルミ複合板+特殊コーティング<br><br>

[抜き型スタイル]<br>
こちらのタイプは、面板を一部くり抜いたデザインになっております。<br>
また、指詰め事故防止のために、抜き型の背面に0.5mm厚の透明塩ビ板を貼っています。<div id="migi-obi">

